import { Component, OnInit } from '@angular/core';
import { AgentService } from '../agent.service';

@Component({
  selector: 'app-agent-status',
  templateUrl: './agent-status.component.html',
  styleUrls: ['./agent-status.component.css']
})
export class AgentStatusComponent implements OnInit {
  status: any = {};

  constructor(private agentService: AgentService) { }

  ngOnInit(): void {
    this.updateStatus();
  }

  updateStatus(): void {
    this.agentService.getStatus().subscribe(data => this.status = data);
  }

  performAction(action: string): void {
    this.agentService.performAction(action).subscribe(() => this.updateStatus());
  }
}

import { Component, OnInit, OnDestroy } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { CommonModule } from '@angular/common';
import { HttpClientModule } from '@angular/common/http';
import { AgentService } from './agent.service';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [RouterOutlet, CommonModule, HttpClientModule],
  templateUrl: './app.component.html',
  styleUrl: './app.component.css'
})
export class AppComponent implements OnInit, OnDestroy {
  gameState: any = null;
  private updateInterval: any;

  constructor(private agentService: AgentService) {}

  ngOnInit() {
    this.updateStatus();
    this.updateInterval = setInterval(() => this.updateStatus(), 2000);
  }

  ngOnDestroy() {
    if (this.updateInterval) {
      clearInterval(this.updateInterval);
    }
  }

  updateStatus() {
    this.agentService.getStatus().subscribe(
      (data) => {
        this.gameState = data;
      },
      (error) => {
        console.error('Error fetching status:', error);
      }
    );
  }

  performAction(action: string) {
    this.agentService.performAction(action).subscribe(
      (data) => {
        this.gameState = data;
      },
      (error) => {
        console.error('Error performing action:', error);
      }
    );
  }

  resetGame() {
    this.agentService.resetGame().subscribe(
      (data) => {
        this.gameState = data;
      },
      (error) => {
        console.error('Error resetting game:', error);
      }
    );
  }
}

import { CommonModule } from '@angular/common';
import { Component, Input, Output, EventEmitter } from '@angular/core';

@Component({
  selector: 'storybook-button',
  standalone: true,
  imports: [CommonModule],
  template: ` <button
  type="button"
  (click)="onClick.emit($event)"
  [ngClass]="classes"
  [ngStyle]="{ 'background-color': backgroundColor }"
>
  {{ label }}
</button>`,
  styleUrls: ['./button.css'],
})
export class ButtonComponent {
  /** Is this the principal call to action on the page? */
  @Input()
  primary = false;

  /** What background color to use */
  @Input()
  backgroundColor?: string;

  /** How large should the button be? */
  @Input()
  size: 'small' | 'medium' | 'large' = 'medium';

  /**
   * Button contents
   *
   * @required
   */
  @Input()
  label = 'Button';

  /** Optional click handler */
  @Output()
  onClick = new EventEmitter<Event>();

  public get classes(): string[] {
    const mode = this.primary ? 'storybook-button--primary' : 'storybook-button--secondary';

    return ['storybook-button', `storybook-button--${this.size}`, mode];
  }
}

